package com.ainotebuddy.app

import android.content.Intent
import android.os.Bundle
import android.widget.Toast
import androidx.activity.ComponentActivity
import androidx.activity.compose.setContent
import androidx.activity.result.contract.ActivityResultContracts
import androidx.compose.foundation.layout.*
import androidx.compose.foundation.lazy.LazyColumn
import androidx.compose.foundation.lazy.items
import androidx.compose.material.icons.Icons
import androidx.compose.material.icons.filled.*
import androidx.compose.material3.*
import androidx.compose.runtime.*
import androidx.compose.ui.Alignment
import androidx.compose.ui.Modifier
import androidx.compose.ui.platform.LocalContext
import androidx.compose.ui.text.font.FontWeight
import androidx.compose.ui.unit.dp
import androidx.lifecycle.viewmodel.compose.viewModel
import com.ainotebuddy.app.data.NoteEntity
import com.ainotebuddy.app.data.PreferencesManager
import com.ainotebuddy.app.features.NoteEditorActivity
import com.ainotebuddy.app.repository.NoteRepository
import com.ainotebuddy.app.ui.components.SimpleNoteCard
import com.ainotebuddy.app.ui.theme.AINoteBuddyTheme
import com.ainotebuddy.app.viewmodel.NoteViewModel
import com.google.android.gms.common.api.ApiException
import dagger.hilt.android.AndroidEntryPoint
import javax.inject.Inject

@AndroidEntryPoint
class MainActivity : ComponentActivity() {

    @Inject
    lateinit var noteRepository: NoteRepository

    @Inject
    lateinit var preferencesManager: PreferencesManager

    private val signInLauncher = registerForActivityResult(
        ActivityResultContracts.StartActivityForResult()
    ) { result ->
        val task = com.google.android.gms.auth.api.signin.GoogleSignIn.getSignedInAccountFromIntent(result.data)
        try {
            val account = task.getResult(ApiException::class.java)
            Toast.makeText(this, "Welcome, ${account.displayName}!", Toast.LENGTH_SHORT).show()
            recreate()
        } catch (e: ApiException) {
            val message = when (e.statusCode) {
                12501 -> "Sign in was cancelled"
                12500 -> "Sign in failed. Please try again."
                10 -> "Developer error: Check SHA1 fingerprint and OAuth configuration"
                7 -> "Network error: Check your internet connection"
                8 -> "Internal error: Please try again later"
                else -> "Sign in failed (Code: ${e.statusCode}): ${e.message}"
            }
            Toast.makeText(this, message, Toast.LENGTH_LONG).show()
        }
    }

    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)

        setContent {
            AINoteBuddyTheme {
                MainScreen()
            }
        }
    }

    @OptIn(ExperimentalMaterial3Api::class)
    @Composable
    fun MainScreen() {
        val noteViewModel: NoteViewModel = viewModel()
        val notes by noteViewModel.notes.collectAsState()
        val context = LocalContext.current

        Scaffold(
            topBar = {
                TopAppBar(
                    title = { 
                        Text(
                            "AI Note Buddy",
                            fontWeight = FontWeight.Bold
                        ) 
                    },
                    actions = {
                        IconButton(
                            onClick = {
                                val intent = Intent(context, NoteEditorActivity::class.java)
                                startActivity(intent)
                            }
                        ) {
                            Icon(Icons.Filled.Add, contentDescription = "Add Note")
                        }
                    }
                )
            },
            floatingActionButton = {
                FloatingActionButton(
                    onClick = {
                        val intent = Intent(context, NoteEditorActivity::class.java)
                        startActivity(intent)
                    }
                ) {
                    Icon(Icons.Filled.Add, contentDescription = "Add Note")
                }
            }
        ) { paddingValues ->
            if (notes.isEmpty()) {
                EmptyStateScreen(
                    modifier = Modifier.padding(paddingValues)
                ) {
                    val intent = Intent(context, NoteEditorActivity::class.java)
                    startActivity(intent)
                }
            } else {
                LazyColumn(
                    modifier = Modifier
                        .fillMaxSize()
                        .padding(paddingValues),
                    contentPadding = PaddingValues(8.dp),
                    verticalArrangement = Arrangement.spacedBy(8.dp)
                ) {
                    items(notes) { note ->
                        SimpleNoteCard(
                            note = note,
                            onClick = { clickedNote ->
                                val intent = Intent(context, NoteEditorActivity::class.java).apply {
                                    putExtra("note_id", clickedNote.id)
                                }
                                startActivity(intent)
                            },
                            onPinClick = { noteToPin ->
                                noteViewModel.togglePin(noteToPin)
                            },
                            onFavoriteClick = { noteToFavorite ->
                                noteViewModel.toggleFavorite(noteToFavorite)
                            }
                        )
                    }
                }
            }
        }
    }

    @Composable
    fun EmptyStateScreen(
        modifier: Modifier = Modifier,
        onCreateNote: () -> Unit
    ) {
        Box(
            modifier = modifier.fillMaxSize(),
            contentAlignment = Alignment.Center
        ) {
            Column(
                horizontalAlignment = Alignment.CenterHorizontally,
                verticalArrangement = Arrangement.Center
            ) {
                Icon(
                    Icons.Filled.NoteAdd,
                    contentDescription = null,
                    modifier = Modifier.size(64.dp),
                    tint = MaterialTheme.colorScheme.primary.copy(alpha = 0.6f)
                )

                Spacer(modifier = Modifier.height(16.dp))

                Text(
                    text = "No notes yet",
                    style = MaterialTheme.typography.headlineMedium,
                    fontWeight = FontWeight.Bold
                )

                Spacer(modifier = Modifier.height(8.dp))

                Text(
                    text = "Create your first note to get started",
                    style = MaterialTheme.typography.bodyLarge,
                    color = MaterialTheme.colorScheme.onSurfaceVariant
                )

                Spacer(modifier = Modifier.height(24.dp))

                Button(
                    onClick = onCreateNote,
                    modifier = Modifier.height(48.dp)
                ) {
                    Icon(
                        Icons.Filled.Add,
                        contentDescription = null,
                        modifier = Modifier.size(20.dp)
                    )
                    Spacer(modifier = Modifier.width(8.dp))
                    Text("Create Note")
                }
            }
        }
    }
}

