    private fun updateIntelligenceCache(noteId: String, analysis: IntegratedNoteAnalysis) {
        val currentCache = _intelligenceCache.value
        val updatedCache = currentCache.copy(
            noteAnalyses = currentCache.noteAnalyses + (noteId to analysis),
